        <header class="entry-header">
            <h2 class="entry-title"><a href="file:///C:/Users/99451/Desktop/firebase/public/post/10/index.html" rel="bookmark">Is Your Collie a Picky Eater? Try This Simple Hack.</a></h2>        </header><!-- .entry-header -->

        <div class="entry-categories">
                    </div>

        <div class="entry-summary">
            Collies&nbsp;are so incredibly varied in their personalities. While some&nbsp;scarf down any food scrap in sight, others have a more picky (or shall we say, 'refined') palate, and quickly tire of their everyday dog food. What can be done when your collie decides to stop eating their food, or is no longer excited about it? The Dog Food Topper Craze and the Dangers of Many Food Toppers for Your Collie Food toppers have become incredibly popular in the pet food/treat industry in recent years, but the concept isn't anything new.        </div><!-- .entry-content -->

