        <header class="entry-header">
            <h2 class="entry-title"><a href="file:///C:/Users/99451/Desktop/firebase/public/post/12/index.html" rel="bookmark">Feeding snacks to coral larvae boosts energy for growth and survival</a></h2>        </header><!-- .entry-header -->

        <div class="entry-categories">
                    </div>

        <div class="entry-summary">
            PhD researcher Colleen Rodd feeding coral larvae. Coral larvae reared with food have more energy to transform into settled polyps and successfully establish themselves as young corals, a Southern Cross University PhD researcher has found.The study, published in the journal Frontiers in Marine Science and led by PhD candidate Colleen Rodd of Southern Cross University, found feeding the larvae provides an energy boost in the critical early stages of development and improves survival.The findings will bolster coral restoration efforts around the globe to recover degraded reef systems – including the coral larval restoration projects known commonly as Coral IVF led by Colleen's supervisor Distinguished Professor Peter Harrison.        </div><!-- .entry-content -->

