        <header class="entry-header">
            <h2 class="entry-title"><a href="file:///C:/Users/99451/Desktop/firebase/public/post/14/index.html" rel="bookmark">Zero Waste is Key to Fighting Inflation &amp; Supply Chain Shortages</a></h2>        </header><!-- .entry-header -->

        <div class="entry-categories">
                    </div>

        <div class="entry-summary">
            By Alfred Twu Besides the environmental benefits, zero waste also helps ease the shortages and inflation driven by supply chain issues. A disposal-based supply chain requires a constant extraction of new raw material to feed the making and delivering of new product. This supply chain often spans the whole globe. After a short lifespan, the products are discarded and new ones are needed. If any component or part of the chain has a problem, production comes to a halt and there are shortages, which then drive up costs.        </div><!-- .entry-content -->

